import React from "react";
import { Link } from "react-router-dom";
import "./Footer.css";

const Footer = () => {
  return (
    <>
      <footer className="footer">
        {localStorage.getItem("token") === "admin" && (
          <Link to={`/admin/book/-1`} className="btn btn-primary" style={{ marginRight: `30px`, width: '100px' }}>
            Add book
          </Link>
        )}
      </footer>
    </>
  );
};

export default Footer;
